    redirect: "/newVue/"
  },
  {
    name: "v-4b83b260198e4",
    path: "/render/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("D:\\WWW\\GitHub\\Vue-analysis\\docs\\render\\index.md").then(comp => {
        Vue.component("v-4b83b260198e4", comp.default)
